import React from 'react';
import './editForm.css';
import FormForAddAndEditProduct from '../formForAddOrEditProduct/Form';
import {ReactComponent as OpenFormSVG} from '../../../assets/openForm.svg';


const EditForm = () => {
    return (
        <div className="editForm">
            <div className="buttonShowForm">
                <button className="showForm">
                    <div className="openFormButtonText">EDIT PPRODUCT</div>
                    <OpenFormSVG className="openFormSvg" />
                </button>
            </div>
            <FormForAddAndEditProduct
                // handleSubmit={} 
            />
            <button 
                type="reset" 
                className="resetFormButton"
            >
                RESET
            </button>
            <button 
                type="cancel" 
                className="cancelChangesButton"
            >
                CANCEL
            </button>
        </div>
    )
}

export default EditForm;
